/**
 * Details of the stop loss order. Only to be used when order_class = BRACKET. stop_price is required, limit_price is optional
 * @export
 * @interface StopLoss
 */
export interface StopLoss {
    [key: string]: any;
    /**
     *
     * @type {string}
     * @memberof StopLoss
     */
    'stop_price'?: string;
    /**
     *
     * @type {string}
     * @memberof StopLoss
     */
    'limit_price'?: string | null;
}
